INSERT INTO `ost_draft` (`id`, `staff_id`, `namespace`, `body`, `created`, `updated`) VALUES
(3, 1, 'ticket.staff', '', '2016-10-26 21:50:10', '2016-10-31 15:37:22'),
(4, 1, 'ticket.staff.response', '', '2016-10-26 21:50:10', '2016-10-31 15:37:22'),
(5, 1, 'ticket.staff.note', '', '2016-10-26 21:50:10', '2016-10-31 15:37:22'),
(12, 0, 'ticket.client.mmt2mkkouiu0', '', '2016-10-27 20:05:25', NULL),
(15, 0, 'ticket.client.miset75vmdj2', '', '2016-10-27 21:23:57', NULL),
(19, 1, 'email.diag', '', '2016-10-28 14:00:54', '2016-10-28 15:54:51'),
(22, 1, 'tpl.ticket.reply.1', '% <h3><strong>Estimado %{recipient.name},</strong></h3> %{response} <br /><br /><div style="color: rgb(127, 127, 127)"> tu % equipo, %{company.name} <br />%{signature}</div> <hr /><div style="color: rgb(127, 127, 127);font-size: small;text-align: center"> <em>esperamos que esta respuesta haya contestado a sus preguntas. Si no, por favor no envie otro correo electrónico. Por el contrario, responda a este correo electrónico o <a href="%{recipient.ticket_link}" style="color: rgb(84, 141, 212)"> ingresar a tu cuenta</a> para un archivo completo de todas sus solicitudes de asistencia y las respuestas.</em></div>', '2016-10-28 15:27:23', NULL),
(23, 1, 'tpl.ticket.activity.notice.1', '<h3><strong>Dear %{recipient.name.first},</strong></h3> <div><em>%{poster.name}</em> sólo registra un mensaje a un Ticket en el que participas.</div> <br />%{message} <br /><br /><hr /><div style="color: rgb(127, 127, 127);font-size: small;text-align: center"> <em>estás consiguiendo este correo electrónico porque usted es un colaborador en Ticket <a href="%{recipient.ticket_link}" style="color: rgb(84, 141, 212)"> #%{ticket.number}</a>. Para participar, simplemente responde a este correo electrónico o <a href="%{recipient.ticket_link}" style="color: rgb(84, 141, 212)"> haga clic aquí</a> para un archivo completo del hilo de Tickets.</em> </div>', '2016-10-28 15:27:32', NULL),
(25, 1, 'tpl.message.autoresp.1', '<h3><strong>Estimado(a) %{recipient.name.first},</strong></h3> Su solicitud de soporte <a href="%{recipient.ticket_link}">#%{ticket.number}</a> Ha sido actualizada<br /> <br /> <div style="color: rgb(127, 127, 127)"> Equipo de Soporte %{company.name},<br /> %{signature} </div> <hr /> <div style="color: rgb(127, 127, 127);font-size: small;text-align: center"><em>Ud puede revisar el avance de su caso <a href="%{recipient.ticket_link}">desde este enlace</a></em> </div>', '2016-10-28 15:31:13', '2016-10-28 15:31:22'),
(28, 0, 'ticket.client.6ob9828jpi96', '', '2016-10-28 19:57:31', '2016-10-28 19:57:41'),
(30, 1, 'canned.2', 'Hola %{ticket.name.first}, <br /> <br /> Su Ticket #%{ticket.number} creado en %{ticket.create_date} está en el departamento %{ticket.dept.name}.', '2016-10-31 15:35:04', '2016-10-31 21:32:20'),
(32, 1, 'canned.1', 'su ticket a sido con numero %{ticket.number} a sido cancelado', '2016-10-31 15:36:55', NULL),
(34, 1, 'tpl.user.accesslink.1', '<h3><strong>Hola %{recipient.name.first},</strong></h3>Una solicitud de enlace #%{ticket.number} has been submitted on your behalf for the helpdesk at %{url}. <br /> <br /> Follow the link below to check the status of the ticket #%{ticket.number}. <br /> <br /> <a href="%{recipient.ticket_link}">%{recipient.ticket_link}</a> <br /> <br />If you <strong>did not</strong> make the request, please delete and disregard this email. Your account is still secure and no one has been given access to the ticket. Someone could have mistakenly entered your email address. <br /> <br /> --<br /> %{company.name}', '2016-10-31 15:54:13', '2016-10-31 21:55:10'),
(35, 0, 'ticket.client.itgt60cvmtc1', '', '2016-10-31 21:49:51', '2016-10-31 21:50:02'),
(36, 1, 'page.3', '<div><h1> <span style="font-size: medium">El sistema de Soporte de Tickets está Fuera de Línea</span> </h1> Gracias por ponerse en contacto con nosotros.<br /> Nuestro sistema de Soporte está fuera de línea en este momento, por favor, vuelva más tarde.<br /> </div>', '2016-10-31 21:52:55', NULL),
(37, 1, 'page.2', '<div>%{ticket.name}, <br /> <br /> Gracias por ponerse en contacto con nosotros. <br /> <br />Su solicitud de soporte ha sido creado y un representante se pondrá en breve en contacto con usted si es necesario.<br /> El Equipo de soporte </div>', '2016-10-31 21:53:07', '2016-10-31 21:53:17'),
(38, 1, 'page.1', '<h1>¡ Bienvenido al centro de soporte</h1> Con el fin de agilizar las solicitudes de soporte y tener un mejor servicio, utilizamos un sistema de Tickets de soporte. Cada solicitud de soporte se le asigna a un número de Ticket único que se puede utilizar para rastrear el progreso y respuestas en línea. Para su referencia proporcionamos archivos completos y la historia de todas sus peticiones de ayuda. Es necesaria una dirección válida de correo electrónico para presentar Ticket. <br />', '2016-10-31 21:53:21', NULL),
(39, 1, 'tpl.note.alert.1', '<h3><strong>Hola %{recipient.name},</strong></h3> Un agente ha registrado actividad en un ticket<a href="%{ticket.staff_link}">#%{ticket.number}</a> <br /> <br /> <table> <tbody> <tr> <td> <strong>De:</strong>: </td> <td> %{note.poster} </td> </tr> <tr> <td> <strong>Título</strong>: </td> <td> %{note.title} </td> </tr> </tbody> </table> <br /> %{note.message} <br /> <br /> <hr /> Para ver o responder el Ticket, por favor <a href="%{ticket.staff_link}">inicie sección</a> en el Sistema de Soporte <br /> <br /> <em style="font-size: small">Att: Tu Servicio de Atención al Cliente</em> <br /> <img src="cid:b56944cb4722cc5cda9d1e23a3ea7fbc" alt="Powered by osTicket" width="126" height="19" style="width: 126px" />}', '2016-10-31 21:54:53', NULL),
(43, 1, 'tpl.assigned.alert.1', '<h3><strong>Hola %{assignee.name.first},</strong></h3> el Ticket <a href="%{ticket.staff_link}">#%{ticket.number}</a> le fue asignado por %{assigner.name.short} <br /> <br /> <table> <tbody> <tr> <td> <strong>De</strong>: </td> <td> %{ticket.name} &lt;%{ticket.email}&gt; </td> </tr> <tr> <td> <strong>Asunto</strong>: </td> <td> %{ticket.subject} </td> </tr> </tbody> </table> <br /> %{comments} <br /> <br /> <hr /> <div>Para ver/responder por favor <a href="%{ticket.staff_link}"><span style="color: rgb(84, 141, 212)">acceder</span></a> al sistema de Soporte técnico</div> <em style="font-size: small">Saluda atte.</em> <br /> <em style="font-size: small">Equipo Soporte Técnico</em> <br /> <a href="http://www.emcorpinternational.com/en/"></a><a href="http://www.emcorpinternational.com/en/"></a><a href="http://www.emcorpinternational.com/en/"><img src="cid:b56944cb4722cc5cda9d1e23a3ea7fbc" alt="Emcorp international" width="126" height="19" style="width: 126px" /></a>', '2016-10-31 22:02:44', NULL),
