  `created` datetime NOT NULL,
  `updated` datetime NOT NULL
) ENGINE=InnoDB DEFAULT CHARSET=utf8;

--
-- Volcado de datos para la tabla `ost_email_template`
--

INSERT INTO `ost_email_template` (`id`, `tpl_id`, `code_name`, `subject`, `body`, `notes`, `created`, `updated`) VALUES
(1, 1, 'ticket.autoresp', 'Ticket de Soporte Abierto [#%{ticket.number}]', '<h3><strong>Estimado %{recipient.name.first},</strong></h3> <p>Una solicitud de apoyo ha sido creado y asignado #%{ticket.number}. Un representante contactará con usted tan pronto como sea posible. Puedes <a href="%{recipient.ticket_link}"> ver el progreso de este Ticket en línea</a>. </p> <br /><div style="color: rgb(127, 127, 127)"> tu % equipo, %{company.name} <br />%{signature}</div> <hr /><div style="color: rgb(127, 127, 127);font-size: small"> <em>si desea proporcionar información respecto al tema o comentarios adicionales, por favor, responda a este correo electrónico o <a href="%{recipient.ticket_link}"> <span style="color: rgb(84, 141, 212)"> ingresar a tu cuenta</span></a> para un archivo completo de sus solicitudes de soporte.</em></div>', NULL, '2016-10-26 15:10:05', '2016-10-26 15:10:05'),
(2, 1, 'ticket.autoreply', 'Re: %{ticket.subject} [#%{ticket.number}]', '<h3><strong>Dear %{recipient.name.first},</strong></h3> Una solicitud de asistencia ha sido creada y asignado un Ticket <a href="%{recipient.ticket_link}"> #%{ticket.number}</a> con la siguiente respuesta automática <br /><br />tema: <strong>%{ticket.topic.name}</strong> <br />tema: <strong>%{ticket.subject}</strong> <br /><br />%{response} <br /><br /><div style="color: rgb(127, 127, 127)"> tu equipo %{company.name} <br />%{signature}</div> <hr /><div style="color: rgb(127, 127, 127);font-size: small"> <em>esperamos que esta respuesta haya respondido suficientemente a a sus preguntas. Si usted desea proporcionar comentarios adicionales o información, por favor, responda a este correo electrónico o <a href="%{recipient.ticket_link}"> <span style="color: rgb(84, 141, 212)"> acceda a su cuenta</span></a> para un archivo completo de sus solicitudes de ayuda.</em></div>', NULL, '2016-10-26 15:10:05', '2016-10-26 15:10:05'),
(3, 1, 'message.autoresp', 'Confirmación de mensaje', '<h3><strong>Estimado(a) %{recipient.name.first},</strong></h3> Su solicitud de soporte <a href="%{recipient.ticket_link}">#%{ticket.number}</a> Ha sido actualizada<br /> <br /> <div style="color: rgb(127, 127, 127)"> Equipo de Soporte %{company.name},<br /> %{signature} </div> <hr /> <div style="color: rgb(127, 127, 127);font-size: small;text-align: center"><em>Ud puede revisar el avance de su caso <a href="%{recipient.ticket_link}">desde este enlace</a></em> </div>', NULL, '2016-10-26 15:10:05', '2016-10-28 10:31:11'),
(4, 1, 'ticket.notice', '%{ticket.subject} [#%{ticket.number}]', '<h3><strong>Estimado %{recipient.name.first},</strong></h3> Nuestro equipo de atención al cliente ha creado un Ticket, <a href="%{recipient.ticket_link}"> #%{ticket.number}</a> en su nombre, con los siguientes datos y Resumen: <br /><br />tema: <strong>%{ticket.topic.name}</strong> <br />tema: <strong>%{ticket.subject}</strong> <br /><br />%{message} <br /><br />si fuera necesario, un representante contactará con usted tan pronto como sea posible. También puede<a href="%{recipient.ticket_link}"> ver el progreso de este Ticket en línea</a>. <br /><br /><div style="color: rgb(127, 127, 127)"> tu % equipo, %{company.name} <br />%{signature}</div> <hr /><div style="color: rgb(127, 127, 127);font-size: small"> <em>si desea proporcionar información respecto al tema o comentarios adicionales, por favor, responda a este correo electrónico o <a href="%{recipient.ticket_link}"> <span style="color: rgb(84, 141, 212)"> acceda a su cuenta</span></a> para un archivo completo de sus solicitudes de soporte.</em></div>', NULL, '2016-10-26 15:10:05', '2016-10-26 15:10:05'),
(5, 1, 'ticket.overlimit', 'Se alcanzó el límite de Tickets', '<h3><strong>Estimado %{ticket.name.first},</strong></h3> Ha alcanzado el número máximo de Tickets abiertos permitido. Para ser capaz de abrir otro Ticket, uno de tus Tickets pendientes debe estar cerrado. Para actualizar o agregar comentarios a un Ticket abierto simplemente <a href="%{url}/tickets.php?e=%{ticket.email}"> ingresa en nuestro servicio de asistencia</a>. <br /><br />Gracias, <br /> sistema de Tickets de soporte', NULL, '2016-10-26 15:10:05', '2016-10-26 15:10:05'),
(6, 1, 'ticket.reply', 'Re: %{ticket.subject} [#%{ticket.number}]', '% <h3><strong>Estimado %{recipient.name},</strong></h3> %{response} <br /><br /><div style="color: rgb(127, 127, 127)"> tu % equipo, %{company.name} <br />%{signature}</div> <hr /><div style="color: rgb(127, 127, 127);font-size: small;text-align: center"> <em>esperamos que esta respuesta haya contestado a sus preguntas. Si no, por favor no envie otro correo electrónico. Por el contrario, responda a este correo electrónico o <a href="%{recipient.ticket_link}" style="color: rgb(84, 141, 212)"> ingresar a tu cuenta</a> para un archivo completo de todas sus solicitudes de asistencia y las respuestas.</em></div>', NULL, '2016-10-26 15:10:05', '2016-10-26 15:10:05'),
(7, 1, 'ticket.activity.notice', 'Re: %{ticket.subject} [#%{ticket.number}]', '<h3><strong>Dear %{recipient.name.first},</strong></h3> <div><em>%{poster.name}</em> sólo registra un mensaje a un Ticket en el que participas.</div> <br />%{message} <br /><br /><hr /><div style="color: rgb(127, 127, 127);font-size: small;text-align: center"> <em>estás consiguiendo este correo electrónico porque usted es un colaborador en Ticket <a href="%{recipient.ticket_link}" style="color: rgb(84, 141, 212)"> #%{ticket.number}</a>. Para participar, simplemente responde a este correo electrónico o <a href="%{recipient.ticket_link}" style="color: rgb(84, 141, 212)"> haga clic aquí</a> para un archivo completo del hilo de Tickets.</em> </div>', NULL, '2016-10-26 15:10:05', '2016-10-26 15:10:05'),
(8, 1, 'message.alert', 'Aviso de nuevo mensaje', '<h3><strong>Hola %{recipient},</strong></h3> Nuevo mensaje añadido al ticket <a href="%{ticket.staff_link}">#%{ticket.number}</a> <br /> <br /> <table> <tbody> <tr> <td> <strong>De</strong>: </td> <td> %{ticket.name} &lt;%{ticket.email}&gt; </td> </tr> <tr> <td> <strong>Departmento</strong>: </td> <td> %{ticket.dept.name} </td> </tr> </tbody> </table> <br /> %{message} <br /> <br /> <hr /> <div>Para ver o responder este ticket, por favor<a href="%{ticket.staff_link}"><span style="color: rgb(84, 141, 212)">acceda</span></a> al sistema de Soporte Técnico</div> <em style="color: rgb(127,127,127);font-size: small"> Saluda Atte. Equipo de Soporte Técnico</em><br /> <img src="cid:b56944cb4722cc5cda9d1e23a3ea7fbc" alt="Powered by osTicket" width="126" height="19" style="width: 126px" />', NULL, '2016-10-26 15:10:05', '2016-10-26 15:10:05'),
(9, 1, 'note.alert', 'Alerta de nueva actividad interna', '<h3><strong>Hola %{recipient.name},</strong></h3> Un agente ha registrado actividad en un ticket<a href="%{ticket.staff_link}">#%{ticket.number}</a> <br /> <br /> <table> <tbody> <tr> <td> <strong>De:</strong>: </td> <td> %{note.poster} </td> </tr> <tr> <td> <strong>Título</strong>: </td> <td> %{note.title} </td> </tr> </tbody> </table> <br /> %{note.message} <br /> <br /> <hr /> Para ver o responder el Ticket, por favor <a href="%{ticket.staff_link}">inicie sección</a> en el Sistema de Soporte <br /> <br /> <em style="font-size: small">Att: Tu Servicio de Atención al Cliente</em> <br /> <img src="cid:b56944cb4722cc5cda9d1e23a3ea7fbc" alt="Powered by osTicket" width="126" height="19" style="width: 126px" />}', NULL, '2016-10-26 15:10:05', '2016-10-26 15:10:05'),
(10, 1, 'assigned.alert', 'Ticket asignado a usted', '<h3><strong>Hola %{assignee.name.first},</strong></h3> el Ticket <a href="%{ticket.staff_link}">#%{ticket.number}</a> le fue asignado por %{assigner.name.short} <br /> <br /> <table> <tbody> <tr> <td> <strong>De</strong>: </td> <td> %{ticket.name} &lt;%{ticket.email}&gt; </td> </tr> <tr> <td> <strong>Asunto</strong>: </td> <td> %{ticket.subject} </td> </tr> </tbody> </table> <br /> %{comments} <br /> <br /> <hr /> <div>Para ver/responder por favor <a href="%{ticket.staff_link}"><span style="color: rgb(84, 141, 212)">acceder</span></a> al sistema de Soporte técnico</div> <em style="font-size: small">Saluda atte.</em> <br /> <em style="font-size: small">Equipo Soporte Técnico</em> <br /> <a href="http://www.emcorpinternational.com/en/"></a><a href="http://www.emcorpinternational.com/en/"><a href="http://www.emcorpinternational.com/en/"><img src="cid:b56944cb4722cc5cda9d1e23a3ea7fbc" alt="Emcorp international" width="126" height="19" style="width: 126px" /></a></a>', NULL, '2016-10-26 15:10:05', '2016-10-31 17:02:41'),
(11, 1, 'transfer.alert', 'Ticket #%{ticket.number} transferido - %{ticket.dept.name}', '<h3>Hola %{recipient},</h3> el Ticket <a href="%{ticket.staff_link}">#%{ticket.number}</a> ha sido transferido al %{ticket.dept.name} departamento por <strong>%{staff.name.short}</strong> <br /> <br /> <blockquote> %{comments} </blockquote> <hr /> <div>Para ver o responder un Ticket, por favor <a href="%{ticket.staff_link}">inicie sesión</a> al sistema de Soporte Técnico. </div> <em style="font-size: small">Saluda atte.</em> <br /> <em style="font-size: small">Equipo Soporte Técnico</em> <br /> <a href="http://osticket.com/"><img width="126" height="19" alt="Powered By osTicket" style="width: 126px" src="cid:b56944cb4722cc5cda9d1e23a3ea7fbc" /></a>', NULL, '2016-10-26 15:10:06', '2016-10-26 15:10:06'),
(12, 1, 'staff.pwreset', 'osTicket Staff Password Reset', '<h3><strong>Hi %{staff.name.first},</strong></h3> A password reset request has been submitted on your behalf for the helpdesk at %{url}. <br /> <br /> If you feel that this has been done in error, delete and disregard this email. Your account is still secure and no one has been given access to it. It is not locked and your password has not been reset. Someone could have mistakenly entered your email address. <br /> <br /> Follow the link below to login to the help desk and change your password. <br /> <br /> <a href="%{reset_link}">%{reset_link}</a> <br /> <br /> <em style="font-size: small">Your friendly Customer Support System</em> <br /> <img src="cid:b56944cb4722cc5cda9d1e23a3ea7fbc" alt="Powered by osTicket" width="126" height="19" style="width: 126px" />', NULL, '2016-10-26 15:10:06', '2016-10-26 15:10:06'),
(13, 1, 'user.accesslink', 'Ticket [#%{ticket.number}] Access Link', '<h3><strong>Hi %{recipient.name.first},</strong></h3> An access link request for ticket #%{ticket.number} has been submitted on your behalf for the helpdesk at %{url}. <br /> <br /> Follow the link below to check the status of the ticket #%{ticket.number}. <br /> <br /> <a href="%{recipient.ticket_link}">%{recipient.ticket_link}</a> <br /> <br />If you <strong>did not</strong> make the request, please delete and disregard this email. Your account is still secure and no one has been given access to the ticket. Someone could have mistakenly entered your email address. <br /> <br /> --<br /> %{company.name}', NULL, '2016-10-26 15:10:06', '2016-10-26 15:10:06');

