INSERT INTO `ost_page` (`id`, `isactive`, `type`, `name`, `body`, `lang`, `notes`, `created`, `updated`) VALUES
(1, 1, 'landing', 'Página de inicio', '<h1>¡ Bienvenido al centro de soporte</h1> <p>Con el fin de agilizar las solicitudes de soporte y tener un mejor servicio, utilizamos un sistema de Tickets de soporte. Cada solicitud de soporte se le asigna a un número de Ticket único que se puede utilizar para rastrear el progreso y respuestas en línea. Para su referencia proporcionamos archivos completos y la historia de todas sus peticiones de ayuda. Es necesaria una dirección válida de correo electrónico para presentar Ticket. </p>', 'es_ES', 'La Página de Destino se refiere al contenido de la vista inicial del Portal del Cliente. La plantilla modifica el contenido visto por encima de los dos enlaces <strong>Abrir un Ticket Nuevo</strong> y <strong>Comprobar Estado del Ticket</strong>.', '2016-10-26 15:10:04', '2016-10-26 15:10:04'),
(2, 1, 'thank-you', 'Gracias', '<div>%{ticket.name},\n<br>\n<br>\nGracias por ponerse en contacto con nosotros.\n<br>\n<br><p>Su solicitud de soporte ha sido creado y un representante se pondrá en breve en contacto con usted si es necesario.</p> El Equipo de soporte </div>', 'es_ES', 'La página de agradecimiento se muestra al cliente cuando un usuario crea un nuevo Ticket a través del portal del cliente.', '2016-10-26 15:10:04', '2016-10-26 15:10:04'),
(3, 1, 'offline', 'Fuera de Línea', '<div><h1>\n<span style="font-size: medium">El sistema de Soporte de Tickets está Fuera de Línea</span>\n</h1>\n<p>Gracias por ponerse en contacto con nosotros.</p>\n<p>Nuestro sistema de Soporte está fuera de línea en este momento, por favor, vuelva más tarde.</p>\n</div>', 'es_ES', 'La página de desconexión aparece en el Portal del Cliente cuando el sistema de soporte está desconectado.', '2016-10-26 15:10:04', '2016-10-26 15:10:04');

